import RegisterForm from "../form/RegisterForm";
import {Navbar,Nav,Link} from 'react-bootstrap'
function Navbar1() {
  return (
    <Navbar bg="dark" variant="dark">
      <Navbar.Brand href="#home">מחברת מתכונים</Navbar.Brand>
      <Nav href="#home" className=''>כל מתכונים</Nav>
      <Nav className="mr-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <Nav.Link href="#features">הרשמה</Nav.Link>
        <Nav.Link href="#pricing">התחברות</Nav.Link>
      </Nav>
    </Navbar>
  );
}

export default Navbar1
